(function() {
    if (app_data.country.toLowerCase() === 'za') {
        $("#edit_residence_country").on('change', function (event) {
            var iso_country = app_data.country.toLowerCase(), os = $(this), value = os.val().toLowerCase(),
                province = $("#edit_province");
            if(iso_country !== value) {
                province.attr("disabled","disabled").val("");
                if (!province.hasClass('upload-not-required')) {
                    province.addClass('upload-not-required')
                }
            } else {
                province.prop("disabled", false);
                province.removeClass('upload-not-required');

            }
        })

        if ($("#edit_residence_country").val() != undefined && $("#edit_residence_country").val().toLowerCase() !== 'za') {
            $("#edit_province").attr("disabled","disabled").val("");
        } else {
            $("#edit_province").removeClass('upload-not-required');
        }
    }

    if ($("#edit-profile-panel-za").length) {
        if ($("#edit_account #edit_idNumber").val().length >= 13 ) {
            $('#edit-profile-panel-za').addClass('no-validate-readonly');
            $("#edit_account #edit_title_0," +
                "#edit_account #edit_title_1," +
                "#edit_account #edit_first_name," +
                "#edit_account #edit_middle_name," +
                "#edit_account #edit_last_name," +
                "#edit_account #edit_birth_date," +
                "#edit_account #edit_nationality," +
                "#edit_account #edit_idNumber "
            ).prop('readonly', true);

            $(':radio:not(:checked)').prop('disabled', true);
            $("#edit_account #edit_nationality, #edit_account #edit_birth_date").prop("disabled", true);
        } else {
            // $("#edit_account input, #edit_account select").attr('readonly', false);
            // $("#edit_account #edit_nationality, #edit_account #edit_birth_date").prop("disabled", false);
            // $("#edit_account #edit_idNumber").attr('readonly', true);
        }

        if ($('#upload-files-panel-za').length) {
            var inputs = $("#edit_account fieldset input, #edit_account fieldset select");

            var toggleSubmitButton = function toggleSubmitButton(disable) {
                var files = $("#upload-files-form :file").filter(function() {return $(this).val();});
                if (!disable && files.length) {
                    $("#upload-files-submit").removeClass("disabled");
                } else {
                    $("#upload-files-submit").addClass("disabled");
                }
            };
            var validateInputs = function validateInputs() {
                for (var i = 0; i < inputs.length; i++) {
                    var input = $(inputs[i]);
                    if (!input.hasClass('upload-not-required') && (
                            (!input.attr('readonly') || input.hasClass('upload-required')) &&
                            (!input.is('select') && !input.val().trim()) ||
                            (input.is('select') && !input.find('option:selected').val()) ||
                            (input.is(":radio") && !$('input[name="'+input.attr('name')+'"]').is(':checked'))
                        )
                    ) {
                        $("#upload-files-form .btn, #upload-files-submit").addClass("disabled");
                        $("#upload-files-form input").prop("disabled", true);
                        toggleSubmitButton(true);
                        return;
                    }
                }
                $("#upload-files-form .btn").removeClass("disabled");
                $("#upload-files-form input").prop("disabled", false);
                toggleSubmitButton();
            };

            inputs.each(function() {
                $(this).on('click change keyup', validateInputs);
            });

            $(function () {
                validateInputs();
            });

            var submitWithFiles = function submitWithFiles(e) {
                e.preventDefault();
                if ($("#upload-files-submit").hasClass('disabled')) {
                    return;
                }
                var form1 = '#edit_account';
                var form2 = '#upload-files-form';

                if (!$(form1).valid()) {
                    $(form1).submit();
                    return;
                }

                if (!$(form2).valid()) {
                    return;
                }

                $('button[type="submit"]').button('loading');
                $(form1 + ' :input[isacopy]').remove();
                $(form2 + ' :input').not(':submit').not('textarea').not('select').each(function() { $(this).attr('value', $(this).val()); });
                $(form2 + ' textarea').each(function() { $(this).text($(this).val()); });
                $(form2 + ' select').each(function() { $('option[value!="' + $(this).val() + '"]', this).remove(); $('option[value="' + $(this).val() + '"]', this).attr('selected', 'selected'); });
                $(form2 + ' :input').not(':submit').clone().hide().attr('isacopy','y').appendTo(form1);
                $(form1).submit();
            };

            $('#upload-files-form').on('change', ':file', function () {
                var input = $(this),
                    numFiles = input.get(0).files ? input.get(0).files.length : 1,
                    label = input.val().replace(/\\/g, '/').replace(/.*\//, '');
                input.trigger('fileselect', [numFiles, label]);
            });

            $('#upload-files-form :file').on('fileselect', function (event, numFiles, label) {
                var input = $(this).parents('.input-group').find(':text'),
                    log = numFiles > 1 ? numFiles + ' files selected' : label;
                if (input.length) {
                    input.val(log);
                    toggleSubmitButton();
                }
            });

            $('#upload-files-form').submit(submitWithFiles);
        }
    }
})();
